import React from "react";
import { useState } from "react";
import "./BirthdayList.css";

function BirthdayList() {
  const [FirstName, setFirstName] = useState({
    name: "Carl McHenry",
    age: 19,
    imgURL:
      "data:image/jpeg;base64,",
  });
  const [SecondName, setSecondName] = useState({
    name: "Anna McFlurry",
    age: 25,
    imgURL:
      "data:image/jpeg;base64,",
  });
  const [ThirdName, setThirdName] = useState({
    name: "Gregory Theodore",
    age: 39,
    imgURL:
      "data:image/jpeg;base64,",
  });
  return (
    <div classname="firstcomponent">
      <section className="birthdaylist">
        <table>
          <tr className="listitems">
            <td>
              <img src={FirstName.imgURL} alt="" />
              <h1>{FirstName.name}</h1>
              <h2>{FirstName.age}</h2>
            </td>
          </tr>
          <tr className="listitems">
            <td>
              <img src={SecondName.imgURL} alt="" />
              <h1>{SecondName.name}</h1>

              <h2>{SecondName.age}</h2>
            </td>
          </tr>
          <tr className="listitems">
            <td>
              <img src={ThirdName.imgURL} alt="" />
              <h1>{ThirdName.name}</h1>
              <h2>{ThirdName.age}</h2>
            </td>
          </tr>
          <button
            type="button"
            className="btn"
            onClick={() =>
              setFirstName(0) || setSecondName(0) || setThirdName(0)
            }
          >
            Clear Items
          </button>
        </table>
      </section>
    </div>
  );
}

export default BirthdayList;
